import AsyncStorage from "@react-native-async-storage/async-storage";
import React, { Component } from "react";
import { SafeAreaView, View, Image, Text, Touchable, TouchableOpacity, TextInput, ScrollView, StyleSheet, Pressable } from "react-native";
import Svg, { Path, Rect } from "react-native-svg";
import Slider from "../slider/Slider";
import DesignerPageNavComponent from "./DesignerPageNav";

export default class DesignerSavedComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      filter: false,
      saveds: [],
      urlImage: 'http://80.78.246.59/Refectio/storage/app/uploads/',

    }
  }


  getMySaveds = async () => {
    let myHeaders = new Headers();
    let userToken = await AsyncStorage.getItem('userToken')
    let AuthStr = "Bearer " + userToken
    myHeaders.append("Authorization", AuthStr);



    let requestOptions = {
      method: 'GET',
      headers: myHeaders,
      redirect: 'follow'
    };

    await fetch("http://80.78.246.59/Refectio/public/api/MyFavoritUser", requestOptions)
      .then(response => response.json())
      .then(result => {
        // console.log('ressssssssssssss', result, 'ressssssssssssss')
        this.setState({
          saveds: result.data,
          // categories: result.data.favorit_users.user_category_product
        })
      })
      .catch(error => console.log('error', error));
    // console.log(this.state.categories)
  }


  componentDidMount() {
    const { navigation } = this.props;
    this.getMySaveds()

    this.focusListener = navigation.addListener("focus", () => {

      this.getMySaveds()

    });
  }

  componentWillUnmount() {
    // Remove the event listener
    if (this.focusListener) {
      this.focusListener();
      console.log(' END')
    }
  }


  render() {
    return (
      <SafeAreaView style={{ flex: 1, }}>
        <View style={styles.main}>


          <View style={styles.nameCompanyParent}>
            <Text style={styles.componyName}>Избранное</Text>
          </View>



          <ScrollView showsVerticalScrollIndicator={false}>
            {
              this.state.saveds.map((item, index) => {
                let count = item.favorit_users.meshok
                return (
                  <View key={index} style={styles.campaign}>
                    <View style={styles.infoCompanyMain}>
                      <Image
                        source={{ uri: this.state.urlImage + item.favorit_users.logo }}
                        style={{
                          width: 70,
                          height: 70,
                          marginRight: 12,
                          borderColor: '#C8C8C8',
                          borderWidth: 1,
                        }}
                      />
                      <View style={styles.infoCompany}>
                        <View>
                          <Text
                            style={{
                              fontSize: 20,
                              fontFamily: 'Raleway_700Bold',
                              marginBottom: 6,
                            }}>
                            {item.favorit_users.company_name}
                          </Text>
                          <View style={{ flexDirection: 'row' }}>
                            {[...new Array(Number(count))].map((value, i) => <Image key={i} source={require('../../assets/image/meshok.png')} style={{ width: 15, height: 20.5, marginRight: 3 }} />)}
                          </View>
                        </View>



                        <Text
                          key={index}
                          style={{
                            fontSize: 16,
                            color: "#A8A8A8",
                            fontFamily: 'Raleway_500Medium',
                            paddingTop: 5
                          }}>
                          {item.favorit_users.made_in}
                        </Text>


                      </View>
                    </View>

                    <View>
                      <ScrollView
                        horizontal={true}
                        showsVerticalScrollIndicator={false}
                        showsHorizontalScrollIndicator={false}
                      >
                        {
                          item.favorit_users.user_category_product.map((category, index) => {
                            return (
                              <Text key={index} style={styles.categoriesName}>{category.category_name}</Text>
                            )
                          })
                        }
                      </ScrollView>
                    </View>
                    <Slider slid={item.favorit_users.user_product_limit1[0].product_image} />
                  </View>
                )
              })
            }
          </ScrollView>
        </View>
        <DesignerPageNavComponent active_page={'Избранное'} navigation={this.props.navigation} />
      </SafeAreaView >
    )
  }
}

const styles = StyleSheet.create({
  main: {
    flex: 1,
    backgroundColor: 'white',
    paddingHorizontal: 15,
    position: "relative"
  },
  nameCompanyParent: {
    marginTop: 12,
    paddingLeft: 2,
    marginBottom: 11
  },
  user: {
    width: 30,
    height: 30,
    backgroundColor: '#F3F3F3',
    justifyContent: 'center',
    alignItems: 'center',
    borderRadius: 15
  },
  componyName: {
    fontSize: 22,
    fontFamily: 'Poppins_500Medium',
    color: '#1571F0'
  },

  campaign: {
    width: '100%',
    marginBottom: 34,
  },
  infoCompanyMain: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
  },
  infoCompany: {
    width: '76%',
    flexDirection: 'row',
    justifyContent: 'space-between'
  },
  categoriesName: {
    fontSize: 13,
    fontFamily: 'Montserrat_400Regular',
    paddingHorizontal: 3,
    paddingVertical: 5,
    marginRight: 11

  },
})
